import React, { useState } from 'react';
import "./style.css"
import Calendar from 'react-calendar';
//import 'react-calendar/dist/Calendar.css';
import Axios from 'axios';

const calender = () => {
    //const [value, onChange] = useState(new Date());
    // State for date selected by user
    const [selectedDate, setSelectedDate] = useState();
    const [employeeList,setEmployeeList] = useState([]);

    // State for text above calander
    const [calendarText, setCalendarText] = useState(`No Date is selected`);
    const handleDateChange = (value) => {
        setSelectedDate(value);
        setCalendarText(`The selected Date is ${value.toDateString()}`);
        let valDate=value.toDateString();
        let valDay=valDate.substring(0, 3);
        //alert(valDay);
        bookSlotday(valDay);
    };

    const bookSlotday = (valDay) => {
        //alert(valDay);
        Axios.post('http://localhost:3001/bookday',{
            bookday:valDay,
        }).then((response) =>{
            setEmployeeList(response.data);
            //alert(JSON.stringify(response.data));
        });
        /*if(valDay=="Sat" || valDay=="Fri")document.querySelector(".emptyslotshead").style.visibility="hidden";
        else document.querySelector(".emptyslotshead").style.visibility="visible";*/
        
        if(valDay=="Sat" || valDay=="Sun")document.querySelector(".emptyslotshead h2").innerHTML="No CLass on Weekends";
        else document.querySelector(".emptyslotshead h2").innerHTML="Choose From Free Slots";
        //document.querySelector(".emptyslotshead").style.transition = "all 2s";
        document.querySelector(".emptyslotshead").style.visibility="visible";
        document.querySelector(".emptyslotshead").style.transform="scale(1)";
    };


  return (
    <div className="calender" data-aos="fade-right">
        <h2>Pick Your Date</h2>
        <Calendar 
            //onChange={onChange} value={value}  
            onChange={handleDateChange}
        />
        {/*<Calendar
            onChange={handleDateChange}
        />*/}
        <div className="emptyslotshead">
            <h2>Choose From Free Slots</h2>
        </div>

        <div className="emptyslots">
            {employeeList.map((item, index) => {
                     return <div>
                        <div key={index} class="employeelist" data-aos="fade-left">
                            <p className="bookRoomNo">{item.roomno} </p>
                            {item.slot1 == '1'? <p className="bookedSlot">8.00 - 9:15 </p>: item.slot1 == '0.25'? <p className="half1FreeSlot">8.00 - 9:15</p> : item.slot1 == '0.75'? <p className="half2FreeSlot">8.00 - 9:15 </p> :<p className="freeSlot" onClick={bookSlot}>8.00 - 9:15 </p>}
                            {item.slot2 == '1'? <p className="bookedSlot">9.15 - 10.30 </p>: item.slot2 == '0.25'? <p className="half1FreeSlot">9.15 - 10.30 </p> : item.slot2 == '0.75'? <p className="half2FreeSlot">9.15 - 10.30 </p> :<p className="freeSlot">9.15 - 10.30 </p>}
                            {item.slot3 == '1'? <p className="bookedSlot">10.30 - 11.45 </p>: item.slot3 == '0.25'? <p className="half1FreeSlot">10.30 - 11.45</p> : item.slot3 == '0.75'? <p className="half2FreeSlot">10.30 - 11.45</p> :<p className="freeSlot">10.30 - 11.45 </p>}
                            {item.slot4 == '1'? <p className="bookedSlot">11.45 - 1.00 </p>: item.slot4 == '0.25'? <p className="half1FreeSlot">11.45 - 1.00</p> : item.slot4 == '0.75'? <p className="half2FreeSlot">11.45 - 1.00</p> :<p className="freeSlot">11.45 - 1.00 </p>}
                            {item.slot5 == '1'? <p className="bookedSlot">1.00 - 2.30 </p>: item.slot5 == '0.25'? <p className="half1FreeSlot">>1.00 - 2.30 </p> : item.slot5 == '0.75'? <p className="half2FreeSlot">>1.00 - 2.30 </p> :<p className="freeSlot">1.00 - 2.30 </p>}
                            {item.slot6 == '1'? <p className="bookedSlot">2.30 - 3.45 </p>: item.slot6 == '0.25'? <p className="half1FreeSlot">2.30 - 3.45 </p> : item.slot6 == '0.75'? <p className="half2FreeSlot">2.30 - 3.45 </p> :<p className="freeSlot">2.30 - 3.45 </p>}
                            {item.slot7 == '1'? <p className="bookedSlot">3.45 - 5.00 </p>: item.slot7 == '0.25'? <p className="half1FreeSlot">3.45 - 5.00 </p> : item.slot7 == '0.75'? <p className="half2FreeSlot">3.45 - 5.00 </p> :<p className="freeSlot">3.45 - 5.00</p>}
                            {/*<p>{item.slot1} </p>
                            <p>{item.slot2} </p>
                            <p>{item.slot3} </p>
                            <p>{item.slot4} </p>
                            <p>{item.slot5} </p>
                            <p>{item.slot6} </p>
                            <p>{item.slot7} </p>*/}
                        </div>
                    </div>
            })}
        </div>

    </div>
  )
}

export default calender
